    "body": "Bumps [yargs-parser](https://github.com/yargs/yargs-parser) from 13.1.1 to 13.1.2. **This update includes a security fix.**\n<details>\n<summary>Vulnerabilities fixed</summary>\n<p><em>Sourced from <a href=\"https://github.com/advisories/GHSA-p9pc-299p-vxgp\">The GitHub Security Advisory Database</a>.</em></p>\n<blockquote>\n<p><strong>Prototype Pollution in yargs-parser</strong>\nAffected versions of <code>yargs-parser</code> are vulnerable to prototype pollution. Arguments are not properly sanitized, allowing an attacker to modify the prototype of <code>Object</code>, causing the addition or modification of an existing property that will exist on all objects.<br />\nParsing the argument <code>--foo.__proto__.bar baz'</code> adds a <code>bar</code> property with value <code>baz</code> to all objects. This is only exploitable if attackers have control over the arguments being passed to <code>yargs-parser</code>.</p>\n<h2>Recommendation</h2>\n<p>Upgrade to versions 13.1.2, 15.0.1, 18.1.1 or later.</p>\n<p>Affected versions: &lt; 13.1.2</p>\n</blockquote>\n</details>\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/yargs/yargs-parser/blob/master/docs/CHANGELOG-full.md\">yargs-parser's changelog</a>.</em></p>\n<blockquote>\n<h2><a href=\"https://github.com/yargs/yargs-parser/compare/v14.0.0...v15.0.0\">15.0.0</a> (2019-10-07)</h2>\n<h3>Features</h3>\n<ul>\n<li>rework <code>collect-unknown-options</code> into <code>unknown-options-as-args</code>, providing more comprehensive functionality (<a href=\"https://github.com/yargs/yargs-parser/commit/ef771ca\">ef771ca</a>)</li>\n</ul>\n<h3>BREAKING CHANGES</h3>\n<ul>\n<li>rework <code>collect-unknown-options</code> into <code>unknown-options-as-args</code>, providing more comprehensive functionality</li>\n</ul>\n<h2><a href=\"https://github.com/yargs/yargs-parser/compare/v13.1.1...v14.0.0\">14.0.0</a> (2019-09-06)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li>boolean arrays with default values (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/185\">#185</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/7d42572\">7d42572</a>)</li>\n<li>boolean now behaves the same as other array types (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/184\">#184</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/17ca3bd\">17ca3bd</a>)</li>\n<li>eatNargs() for 'opt.narg === 0' and boolean typed options (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/188\">#188</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/c5a1db0\">c5a1db0</a>)</li>\n<li>maybeCoerceNumber now takes precedence over coerce return value (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/182\">#182</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/2f26436\">2f26436</a>)</li>\n<li>take into account aliases when appending arrays from config object (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/199\">#199</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/f8a2d3f\">f8a2d3f</a>)</li>\n</ul>\n<h3>Features</h3>\n<ul>\n<li>add configuration option to &quot;collect-unknown-options&quot; (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/181\">#181</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/7909cc4\">7909cc4</a>)</li>\n<li>maybeCoerceNumber() now takes into account arrays (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/187\">#187</a>) (<a href=\"https://github.com/yargs/yargs-parser/commit/31c204b\">31c204b</a>)</li>\n</ul>\n<h3>BREAKING CHANGES</h3>\n<ul>\n<li>unless &quot;parse-numbers&quot; is set to &quot;false&quot;, arrays of numeric strings are now parsed as numbers, rather than strings.</li>\n<li>we have dropped the broken &quot;defaulted&quot; functionality; we would like to revisit adding this in the future.</li>\n<li>maybeCoerceNumber now takes precedence over coerce return value (<a href=\"https://github-redirect.dependabot.com/yargs/yargs-parser/issues/182\">#182</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li>See full diff in <a href=\"https://github.com/yargs/yargs-parser/commits\">compare view</a></li>\n</ul>\n</details>\n<details>\n<summary>Maintainer changes</summary>\n<p>This version was pushed to npm by <a href=\"https://www.npmjs.com/~oss-bot\">oss-bot</a>, a new releaser for yargs-parser since your current version.</p>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=yargs-parser&package-manager=npm_and_yarn&previous-version=13.1.1&new-version=13.1.2)](https://dependabot.com/compatibility-score/?dependency-name=yargs-parser&package-manager=npm_and_yarn&previous-version=13.1.1&new-version=13.1.2)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\nIf all status checks pass Dependabot will automatically merge this pull request.\n\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot use these labels` will set the current labels as the default for future PRs for this repo and language\n- `@dependabot use these reviewers` will set the current reviewers as the default for future PRs for this repo and language\n- `@dependabot use these assignees` will set the current assignees as the default for future PRs for this repo and language\n- `@dependabot use this milestone` will set the current milestone as the default for future PRs for this repo and language\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in your Dependabot [dashboard](https://app.dependabot.com):\n- Update frequency (including time of day and day of week)\n- Pull request limits (per update run and/or open at any time)\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
